did.abstract:
Collection includes reports; letter; station log (1948-1951);
        minutes of the Cornell Radio Guild, Inc. (1971); Board minutes (1968); published Program
        Guides (1959-1965); and other materials pertaining to Cornell radio station WVBR.

relatedmaterial.p:
See also collection #37-7-m.1055 for audio and transcript of the 1952 student raid of WVBR;
        Robert A. Mayers WVBR - Live Audio, #35-9-3768; and Ted Osborn, WVBR Records,
        #35-9-3512. Also Bound for Glory records, #35-9-4277.
